$backgroundColor: #9d695a;
$tileColor1: #78e0dc;
$tileColor2: #d496a7;
$tileColor3: #ffd166;
$player2Color: #302f31;
$player1Color: #ffffff;
$mainFont: 'Share Tech Mono';
$secondaryFont: 'Euphoria Script';

h1 {
    color: black;
    font-family: $mainFont;
    position: absolute;
    font-size: 3vw;
    top: 0.5%;
}

body {
    margin: 0;
    min-height: 100%;
    overflow: auto;
}

html {
    margin: 0;
    height: 100%;
}

.background {
    background: $backgroundColor;
    height: 100vh;
}

.play_space {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-around;
    height: 100vh;
}

.tiles_container {
    height: 90vh;
    width: 30vh;
    display: flex;
    flex-direction: row;
    justify-content: center;
}

.tile_column {
    width: 100%;
    height: 100%;
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.player-tokens {
    width: 10vh;
    position: absolute;
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.left {
    .grey {
        left: 30vw;
        top: 20vh;
    }
}

.right {
    .white {
        right: 30vw;
        top: 20vh;
    }
}

.tile {
    width: 90%;
    height: 10%;
    margin: 5%;
    border-radius: 20%;
    filter: drop-shadow(13px 11px 1px rgba(0, 0, 0, 0.25));
}

.tile:hover {
    animation: tileHover 0.5s ease-in-out infinite alternate;
}

@keyframes tileHover {
    100% {
        transform: translateY(-10%);
        filter: drop-shadow(17px 14px 3px rgba(0, 0, 0, 0.25));
    }
}

.tile_style_1 {
    background: $tileColor1;
}

.tile_style_2 {
    background: $tileColor2;
}

.rosette {
    background: $tileColor3;
    border-radius: 0%;
    filter: drop-shadow(7px 5px 1px rgba(0, 0, 0, 0.25));
}

.token {
    width: 80%;
    padding-top: 80%;
    border-radius: 100px;
    position: relative;
    filter: drop-shadow(6px 4px 0px rgba(0, 0, 0, 0.25));
    margin: 5px;
}

.token-style-1 {
    background: $player1Color;
}

.token-style-2 {
    background: $player2Color;
}

.score_space {
    box-shadow: 0 0 0;
    background-image: none;
}

.dice-button {
    width: 10vw;
    height: 10vw;
    left: 10%;
    top: 35%;
    background: $tileColor1;
    border-radius: 20%;
    position: absolute;
    display: flex;
    justify-content: center;
    align-items: center;
}

.dice-button:active {
    transform: translateY(4px);
}

.die-imgs {
    display: flex;
    flex-direction: row;
    flex-wrap: wrap;
    justify-content: center;
    align-content: center;
}
.die-img {
    width: 48%;
}

.die_number {
    display: inline-block;
    font-size: 200%;
    text-align: center;
    font-family: $mainFont;
    width: 48%;
}

.active_space {
    background: white;
}

.player_grey_score {
    font-size: 3vw;
    position: absolute;
    left: 5%;
    bottom: 5%;
    font-family: $mainFont;
    border-radius: 35px;
}

.player_white_score {
    font-size: 3vw;
    position: absolute;
    right: 5%;
    bottom: 5%;
    font-family: $mainFont;
    border-radius: 35px;
}

.active_player {
    width: 30%;
    padding-top: 30%;
    border-radius: 100px;
    position: absolute;
    top: -50%;
    right: 35%;
    margin: 5px;
    background: white;
}

.roll-indicator {
    // position: absolute;
    // right: 86%;
    // top: 38%;
    font-family: $secondaryFont;
    font-size: 40px;
    color: black;
}

.invisible {
    display: none;
}
